options.css:
/* Deixa o painel em si totalmente transparente */
html, body, .panel-content {
  background: transparent !important;
  margin: 0;
  padding: 0;
}

options.onRender:
// Fundo global UrbanFlow (somente azuis, sem verde-água)
// Acessa o documento principal (fora do iframe)
const doc = window.top.document;

// Remove fundo anterior, se existir
const oldBg = doc.getElementById('uf-global-bg');
if (oldBg) oldBg.remove();

const oldStyle = doc.getElementById('uf-global-bg-style');
if (oldStyle) oldStyle.remove();

// Cria o <style> com a animação e o estilo do fundo
const style = doc.createElement('style');
style.id = 'uf-global-bg-style';
style.textContent = `
  @keyframes ufGradientShift {
    0%   { background-position: 0% 50%; }
    50%  { background-position: 100% 50%; }
    100% { background-position: 0% 50%; }
  }

  #uf-global-bg {
    position: fixed;
    top: 0;
    left: 0;
    width: 100vw;
    height: 100vh;
    z-index: -1; /* atrás de tudo */
    pointer-events: none; /* não bloqueia cliques */

    /* Fundo base escuro em tons de azul/petróleo */
    background:
      radial-gradient(circle at 20% 0%, rgba(27, 60, 89, 0.22), transparent 55%),
      radial-gradient(circle at 80% 100%, rgba(15, 23, 42, 0.20), transparent 55%),
      linear-gradient(-45deg, #020617, #0B1F33, #1B3C59, #020617);
    background-size: 260% 260%;
    animation: ufGradientShift 22s ease-in-out infinite;
  }
`;
doc.head.appendChild(style);

// Cria o elemento de fundo global
const bg = doc.createElement('div');
bg.id = 'uf-global-bg';
doc.body.appendChild(bg);

options.getOption:
// KPI — Atraso médio (min) | melhor = menor
function getPairs(fr) {
  const t = fr?.fields?.find(f => f.name === 'time')?.values,
    v = fr?.fields?.find(f => f.name === 'value')?.values;
  const out = [];
  if (t && v) {
    for (let i = 0; i < Math.min(t.length, v.length); i++)
      out.push([+new Date(t.get(i)), Number(v.get(i))]);
    out.sort((a, b) => a[0] - b[0]);
  }
  return out;
}
function lastTwo(a) { return a.length ? [a[a.length - 2] ?? null, a[a.length - 1]] : [null, null]; }
function colorBy(v, steps) { let c = steps[0].color; for (const s of steps) { if (v >= s.value) c = s.color } return c; }

const frames = context.panel.data.series || [];
const data = getPairs(frames[0]);

const [prev, cur] = lastTwo(data) || [];
const curV = cur ? cur[1] : NaN,
  prevV = prev ? prev[1] : NaN;

const change = (
  (isFinite(curV) && isFinite(prevV))
    ? ((curV - prevV) / Math.max(Math.abs(prevV), 1e-9) * 100)
    : 0
);

const goodDown = true;
const up = change > 0;
const sign = up ? '↗' : '↘';

const isDark = context.grafana.theme.isDark;
const palette = isDark
  ? { main: '#60A5FA', text: '#E5E7EB', sub: '#94A3B8', good: '#22C55E', bad: '#EF4444' }
  : { main: '#2563EB', text: '#111827', sub: '#475569', good: '#16A34A', bad: '#DC2626' };

const thresholds = [
  { value: 0, color: palette.good },
  { value: 7, color: '#F59E0B' },
  { value: 10, color: palette.bad }
];

const mainColor = colorBy(curV, thresholds);
const deltaColor = (goodDown ? !up : up) ? palette.good : palette.bad;

return {
  backgroundColor: 'transparent',
  grid: { left: 6, right: 6, top: 40, bottom: 30 },

  xAxis: { type: 'time', show: false },
  yAxis: { type: 'value', show: false },

  series: [{
    type: 'line',
    data,
    showSymbol: false,
    areaStyle: { opacity: 0.08, color: palette.main },
    lineStyle: { width: 2, color: palette.main }
  }],

  graphic: [
    // título (canto sup. esquerdo)
    {
      type: 'text',
      left: 8,
      top: 6,
      style: {
        text: 'Atraso médio',
        fill: palette.sub,
        fontWeight: 600,
        fontSize: 12
      }
    },

    // unidade (canto sup. direito) -> CONTINUA EM CIMA
    {
      type: 'text',
      right: 8,
      top: 6,
      style: {
        text: 'min',
        fill: palette.sub,
        fontSize: 12
      }
    },

    // valor grande no centro
    {
      type: 'text',
      left: 'center',
      top: 'center',
      style: {
        text: isFinite(curV) ? curV.toFixed(1) : '—',
        fill: mainColor,
        fontSize: 34,
        fontWeight: 700
      }
    },

    // % mudança (canto inf. esquerdo) -> FICA ONDE JÁ ESTAVA
    {
      type: 'text',
      left: 8,
      bottom: 6,
      style: {
        text: `${sign} ${change.toFixed(1)}%`,
        fill: deltaColor,
        fontSize: 12
      }
    },

    // ÍCONE DE DOWNLOAD (canto inf. direito)
    {
      type: 'text',
      right: 8,
      bottom: 6,
      style: {
        text: '⇩',                 // pode trocar por outro símbolo se quiser
        fill: palette.sub,
        fontSize: 14,
        fontWeight: 600,
        cursor: 'pointer'
      },
      onclick: function () {
        const chart = context?.panel?.chart;
        if (!chart) return;

        const bg = isDark ? '#020617' : '#ffffff';
        const dataURL = chart.getDataURL({
          type: 'png',
          pixelRatio: 2,
          backgroundColor: bg
        });

        const a = document.createElement('a');
        a.href = dataURL;
        a.download = 'kpi_atraso_medio.png';
        a.click();
      }
    }
  ],

  tooltip: { trigger: 'axis' }
};

