// --- Gráfico de barras empilhadas: Semáforos por bairro e tipo de funcionamento ---

const isDark = context.grafana.theme.isDark;

const colorPalette = [
  '#60A5FA', // Azul
  '#22C55E', // Verde
  '#F59E0B', // Amarelo
  '#EF4444', // Vermelho
  '#A855F7', // Roxo
  '#14B8A6', // Ciano
  '#EAB308'  // Dourado
];

const frames = context.panel.data.series || [];

const bairrosSet = new Set();
const tiposSet = new Set();
const dataMap = {};
const totalPorBairro = {};

for (const fr of frames) {
  const fBairro = fr.fields.find(f => f.name === 'bairro');
  const fFunc = fr.fields.find(f => f.name === 'funcionamento');
  const fTotal = fr.fields.find(f => f.name === 'total');

  if (!fBairro || !fFunc || !fTotal) continue;

  const len = fBairro.values.length;

  for (let i = 0; i < len; i++) {
    const bairro = fBairro.values.get(i);
    const tipo = fFunc.values.get(i);
    const total = Number(fTotal.values.get(i) ?? 0);

    if (!bairro || !tipo) continue;

    bairrosSet.add(bairro);
    tiposSet.add(tipo);

    if (!dataMap[tipo]) dataMap[tipo] = {};
    dataMap[tipo][bairro] = (dataMap[tipo][bairro] || 0) + total;

    totalPorBairro[bairro] = (totalPorBairro[bairro] || 0) + total;
  }
}

let bairros = Array.from(bairrosSet);
bairros.sort((a, b) => (totalPorBairro[b] || 0) - (totalPorBairro[a] || 0));

const tipos = Array.from(tiposSet);

const series = tipos.map((tipo, i) => ({
  name: tipo,
  type: 'bar',
  stack: 'total',
  data: bairros.map(b => dataMap[tipo]?.[b] || 0),
  itemStyle: { color: colorPalette[i % colorPalette.length] },
  label: {
    show: false,
    color: '#E5E7EB'
  }
}));

return {
