    axisLabel: {
      color: '#E5E7EB',
      fontSize: 12,
      fontWeight: 600,
      align: 'right',     // alinha com a borda
      margin: 10          // afastado do eixo
    }
  },

  series,

  tooltip: {
    trigger: 'axis',
    axisPointer: { type: 'shadow' },
    backgroundColor: isDark ? '#1E293B' : '#F9FAFB',
    borderWidth: 0,
    textStyle: { color: isDark ? '#F1F5F9' : '#0F172A' },
    formatter: params => {
      if (!params?.length) return '';
      let txt = `<b>${params[0].name}</b><br/>`;
