// paleta de cores por faixa
const palette = isDark
  ? ['#0EA5E9', '#22C55E', '#A3E635', '#FACC15', '#FB923C', '#F97316', '#EF4444', '#EC4899', '#8B5CF6', '#6366F1', '#14B8A6']
  : ['#0369A1', '#15803D', '#65A30D', '#D97706', '#F97316', '#EA580C', '#DC2626', '#DB2777', '#7C3AED', '#4338CA', '#0D9488'];

const frames = context.panel.data.series || [];
const fr = frames[0];
if (!fr) return {};

const fHora = fr.fields.find(f => f.name === 'hora');

const bands = [
  { field: 'v_0a10', label: '0–10 km/h' },
  { field: 'v_11a20', label: '11–20 km/h' },
  { field: 'v_21a30', label: '21–30 km/h' },
  { field: 'v_31a40', label: '31–40 km/h' },
  { field: 'v_41a50', label: '41–50 km/h' },
  { field: 'v_51a60', label: '51–60 km/h' },
  { field: 'v_61a70', label: '61–70 km/h' },
  { field: 'v_71a80', label: '71–80 km/h' },
  { field: 'v_81a90', label: '81–90 km/h' },
  { field: 'v_91a100', label: '91–100 km/h' },
  { field: 'v_acima100', label: '> 100 km/h' }
];

// eixo X (horas)
const labels = [];
if (fHora) {
  const len = fHora.values.length;
  for (let i = 0; i < len; i++) {
    labels.push(String(fHora.values.get(i)));
  }
}

const series = bands.map((b, idx) => {
  const f = fr.fields.find(f => f.name === b.field);
  const data = [];
  if (f) {
    const len = f.values.length;
    for (let i = 0; i < len; i++) data.push(Number(f.values.get(i) ?? 0));
  }
  return {
    name: b.label,
    type: 'line',
    stack: 'total',
    areaStyle: { opacity: 0.7 },
    showSymbol: false,
    lineStyle: { width: 1 },
    itemStyle: { color: palette[idx % palette.length] },
    data
  };
});

const textColor = isDark ? '#E5E7EB' : '#0F172A';
const subColor = isDark ? '#94A3B8' : '#6B7280';

// grid mais claro
const gridColor = isDark
  ? 'rgba(148,163,184,0.35)'   // mais claro no dark
  : 'rgba(148,163,184,0.45)';  // mais evidente no light

return {
  backgroundColor: 'transparent',

  title: {
    text: 'Distribuição de velocidades (por hora)',
    left: 'center',
    top: 4,
    textStyle: { color: textColor, fontSize: 14, fontWeight: 600 }
  },

  legend: {
    top: 28,
    left: 'center',
    textStyle: { color: textColor, fontSize: 10 },
    padding: [0, 40, 0, 40],
    icon: 'circle'
  },

  // + espaço na esquerda para não cortar labels
  grid: { left: 70, right: 32, top: 80, bottom: 30 },

  xAxis: {
    type: 'category',
    data: labels,
    axisLabel: {
      color: subColor,
      fontSize: 11,
      formatter: v => `${v}h`
    },
    axisTick: { show: false },
    axisLine: { lineStyle: { color: subColor } },
    splitLine: {
      show: true,
      lineStyle: { color: gridColor, type: 'dashed', width: 0.8 }
    }
  },

  yAxis: {
    type: 'value',
    axisLabel: { color: subColor, fontSize: 11 },
    splitLine: {
      show: true,
      lineStyle: { color: gridColor, type: 'dashed', width: 1 }
    },
    axisLine: { show: false }
  },

  series,

  tooltip: {
    trigger: 'axis',
    axisPointer: { type: 'line' },
    backgroundColor: isDark ? '#020617' : '#F9FAFB',
    borderWidth: 0,
    textStyle: { color: textColor, fontSize: 12 },
    formatter: params => {
      if (!params || !params.length) return '';
      const hora = params[0].axisValue;
      let txt = `<b>${hora}h</b><br/>`;
      let total = 0;
      for (const p of params) {
        total += Number(p.data || 0);
        txt += `${p.marker} ${p.seriesName}: <b>${p.data}</b><br/>`;
      }
      txt += `<br/><b>Total: ${total}</b>`;
      return txt;
    }
  },

  graphic: [
    {
      type: 'text',
