// --- Barras: TOP 15 corredores monitorados ---

const isDark = context.grafana.theme.isDark;

const palette = isDark
  ? { bar: '#38BDF8', text: '#E5E7EB', sub: '#94A3B8', grid: '#1E293B' }
  : { bar: '#0EA5E9', text: '#0F172A', sub: '#6B7280', grid: '#E5E7EB' };

const frames = context.panel.data.series || [];

let corredores = [];
let valores = [];

// Lê colunas 'corredor_principal' e 'total'
for (const fr of frames) {
  const fCor = fr.fields.find(f => f.name === 'corredor_principal');
  const fTot = fr.fields.find(f => f.name === 'total');
  if (!fCor || !fTot) continue;

  const len = fCor.values.length;
  for (let i = 0; i < len; i++) {
    const nome = String(fCor.values.get(i));
    const val = Number(fTot.values.get(i) ?? 0);
    corredores.push(nome);
    valores.push(val);
  }
}

// Ordena por quantidade (maior → menor)
let idx = [...valores.keys()].sort((a, b) => valores[b] - valores[a]);

// --- TOP N corredores ---
const TOP = 15;
if (idx.length > TOP) idx = idx.slice(0, TOP);

corredores = idx.map(i => corredores[i]);
valores = idx.map(i => valores[i]);

return {
  backgroundColor: 'transparent',

  title: {
    text: 'Top 15 corredores monitorados (câmeras)',
    left: 'center',
    top: 4,
    textStyle: {
      color: palette.text,
