    splitLine: {
      show: true,
      lineStyle: {
        color: palette.grid,
        type: 'dashed',
        width: 0.8
      }
    }
  },

  yAxis: {
    type: 'category',
    data: corredores,
    inverse: true, // mostra o maior em cima
