      color: palette.text,
      fontSize: 11,
      fontWeight: 600,
      margin: 12,
      width: 200,
      overflow: 'truncate'
    }
  },

  series: [{
    name: 'Câmeras',
    type: 'bar',
    data: valores,
    barWidth: 20,
    itemStyle: {
      color: palette.bar,
      borderRadius: [0, 4, 4, 0]
    },
